import React from "react";
import styled from "styled-components";

const Container = styled.div`
  height: auto;
`;

const MenuBar = () => {
  return (
    <Container>
      <div className="left-box">
        <ul>
          <li>Promotion</li>
        </ul>
      </div>
      <div className="right-box"></div>
    </Container>
  );
};

export default MenuBar;
